 \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 14, \"offset\": 69}]}, {\"key\": \"4am9g\", \"data\": {}, \"text\": \"First, we install the file-loader library $ npm install file-loader --save-dev, this will install it as a dev-dependency.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 36, \"offset\": 42}]}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-21 08:29:33','2021-12-21 08:29:33',NULL,NULL,NULL,NULL,NULL,'live'),(176,1,'260e6998-6238-11ec-9947-9c7bef452e53','Test','Using image tag for static SVGs\nIn order to be able to use SVGs or any other image format in the img <img src={} /> we have to set up a file loader system in whichever module bundler we are using(Webp','{\"blocks\": [{\"key\": \"d1744\", \"data\": {}, \"text\": \"Using image tag for static SVGs\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 31, \"offset\": 0}]}, {\"key\": \"c5h5d\", \"data\": {}, \"text\": \"In order to be able to use SVGs or any other image format in the img <img src={} /> we have to set up a file loader system in whichever module bundler we are using(Webpack, Parcel, etc). Here I will show you how to set it up in a few steps if you are already using Webpack.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 14, \"offset\": 69}]}, {\"key\": \"4am9g\", \"data\": {}, \"text\": \"First, we install the file-loader library $ npm install file-loader --save-dev, this will install it as a dev-dependency.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 36, \"offset\": 42}]}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-21 08:29:43','2021-12-21 08:29:43',NULL,NULL,NULL,NULL,NULL,'live');
